    return (
        <Container>
            <Navbar />
            <Announcement />
            <Title>Dresses</Title>
            <FilterContainer>
                <Filter>filter</Filter>
                <Filter>filter2</Filter>
            </FilterContainer>

            <Products />
        </Container>
    )
}

export default ProductList;
